INSERT INTO `product` VALUES (0000000001, 0, 109, '冬山河好農家小木屋', '<p>\r\n	【好農家】就是我們的家～大家的家。位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>國際童玩節會場旁.<br />\r\n	<br />\r\n	希望來這裡遊玩的旅客能盡情感受鄉下農村傳統長型木屋三合院的純樸與休閒，同時能享受到純天然木材散發的芬多精，而又像回到家中那般的舒適與自由。從進入到大廳自個兒泡杯濃濃的咖啡開始，就千萬別拘束喔，把這裡當成自己的家就可以了！附有KTV設備的大廳，就跟朋友一塊兒來飆首歌～作為這場旅遊的開場序曲吧！<br />\r\n	<br />\r\n	&nbsp;</p>\r\n', '2012-08-16', NULL, '20120816191918.jpg', '0', '大同鄉', '0', 0, '宜蘭縣', '宜蘭縣大同鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000002, 0, 111, '神秘湖', '<p>\r\n	神秘湖位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣南澳鄉，地處深山之間，路途崎嶇難行，至今仍保有原始的森林風貌及珍貴的生態資源，因其湖神秘莫測，當地的居民又稱之為「鬼湖」。神祕湖海拔高度約在一千公尺，是一座高山的封閉湖泊，湖面長度約兩百公尺，寬度則約有一百公尺，湖中有田螺、泥鰍及螃蟹等多種水生動物，還有松鼠、山羌及山鼠等野生動物出沒，生長有細葉眼子菜、水社柳及東亞黑三棱等較為稀有的植物，及六十餘種的鳥類及兩百多種的蝶類，動植物生態豐富，相當值得推廣及保育。</p>\r\n', '2012-08-16', NULL, '20120816192341.jpg', '0', '南澳鄉', '0', 0, '宜蘭縣', '宜蘭縣南澳鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000003, 0, 112, '羅東夜市', '<p>\r\n	羅東夜市位在羅東公園旁，由興東路、民生路、公園路及民權路形成方塊型，是羅東市區相當熱鬧的區域，不僅有眾多平價的服飾、雜貨及美食等多種店鋪攤販，日間則為家庭主婦經常前往購物的羅東菜市場。羅東夜市擁有許多美味小吃，包括龍鳳腿、台灣鹹滷味及包心粉圓等人氣小吃，其中又以曾於國宴料理中的肉捲最為著名，經常吸引許多民眾慕名前來品嘗。</p>\r\n', '2012-08-16', NULL, '20120816192506.jpg', '0', '羅東鎮', '0', 0, '宜蘭縣', '宜蘭縣羅東鎮', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000004, 0, 113, '北濱公園', '<p>\r\n	北濱公園位於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>市區東北角，介於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>港和美崙溪之間，往南通向南濱公園，往北則可走向七星潭，佔地十分廣闊。沿濱海大道前行，太平洋毫無遮掩的呈現眼前。海岸山脈山脊自海中赫然隆起。路邊花木扶疏，兩邊夾道盛開的白色野薑，情致甚美，大理石鋪成的曲徑綿廷無盡，坡地綠草如茵，海邊浪花似雪。海灘上無論釣魚、拾貝、漫步，或欣賞蔚藍天空，都令人心曠神怡，沿途並有涼亭與座椅，可以邀三五好友一起野餐談天。最適宜在清晨、傍晚或是夜間，徐徐沿著此步道散步，體會<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>的海天魅力。</p>\r\n', '2012-08-16', NULL, '20120816192703.jpg', '0', '花蓮市', '0', 0, '花蓮縣', '花蓮縣花蓮市', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000005, 0, 114, '德燕漁場', '<p>\r\n	德燕漁場有「曼波魚故鄉」的美譽，每年的曼波魚產量佔<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>縣的60%。漁場內設有定置漁網，是補捉曼波魚的主要工具，若遇上漁民收網的話，現場就可以成為解說定置漁網構造及如何收網的活動教室。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	海灘上的漁網倉庫經過閒置空間再利用的規劃之後，成為漁業體驗教室，可以讓遊客進一步了解漁業生活，感受漁業文化。在定置漁場的海灘邊，設有海濱植物園區，園中有二條步道，一條通往防風林，是自導式解說步道，可以輕鬆了解防風林的特色。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	另一條則是臨著海灘走，繼續欣賞海邊風景。步道的盡頭是觀景樓，登上高樓，可以將七星潭與漁場的美景一覽無遺，輕歇在高樓上，聽聽浪聲、吹吹海風、曬曬暖陽，張開雙手變成翅膀，恣意徜徉在這屬於曼波魚的故鄉海洋！</p>\r\n', '2012-08-16', NULL, '20120816193643.jpg', '0', '新城鄉', '0', 0, '花蓮縣', '花蓮縣新城鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000006, 0, 115, '阿美文化村', '<p>\r\n	阿美文化村的地點，傳說就是阿美族人的獨木舟登陸的地點。村內主要有各種民族文物、舞蹈和工藝的展示，讓人們能更進一步的認識原住民的文化。文化村周圍的圍牆將其與外界隔開，兩排竹舍儼然，古樸中散發濃郁的原住民文化氣息。村中央有一尊高達二十二公尺的神像供人瞻仰留念，村內除了經營紀念品、飾品、大理石器及土產店外，並陳列了許多阿美族原始住屋、服飾、日用器皿、漁獵工具及山胞最早來台所乘載的獨木舟等文物，是遊客認識阿美文化最佳的場所。阿美族男女歌聲渾雄柔美，舞姿美妙動人，傳統山地歌舞表演風格獨特，名聞遐邇。每日有五場次表演，除末兩場固定表演外，其餘三場依人數多寡再決定是否表演，節目主持人係每年豐年祭中選出的阿美皇后，其演出的項目包括婚禮舞、追源舞、農耕舞打米舞，勇士精神舞等。村內主要有各種民族文物、舞蹈和工藝的展示，讓人們能更進一步的認識原住民的文化。來到這裡的遊客總是會被傳統的原住民舞蹈所吸引，阿美族人們的舞蹈和他們生活是習習相關，變化出各種的舞步，這些舞步中所散發出來的就是他們活躍的生命及對於天的感謝。族人將生活所擁有的一切都以舞蹈和歌聲來呈現，因為他們認為上蒼能看到他們真心的舞蹈。此外村中並置有獨特的大餐，來此一遊可盡情享受視覺上的娛樂，同時可飽嘗美食，實為一娛樂休閒的好去處。此外村內還有部落之旅，讓遊客們可以更深入瞭解阿美族的文化。</p>\r\n', '2012-08-16', NULL, '20120816193824.jpg', '0', '吉安鄉', '0', 0, '花蓮縣', '花蓮縣吉安鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000007, 0, 116, '菸樓', '<p>\r\n	豐田曾是花東縱谷重要的菸草栽植地區。日人於大正二年首次引進美國黃色種菸草，在吉野移民村(吉安鄉)種植，並逐漸擴及豐田移民村。為改良菸草品種與研發耕作技術，大正七年更於中里(今豐里村)設菸草耕作指導所，菸葉盛極一時。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	早年只要看看各家的「煙樓」數量就可以知道該戶家的富裕程度。菸田裡，菸農熟練地於談笑間採下片片「綠片黃金」，高聳的煙樓在烤菸時飄著濃郁的香氣，並為寒冬帶來暖意。現在菸葉雖沒落，但在豐裡、豐坪仍可見到廣島式、大阪市菸樓的舊觀，為過往菸草歲月留下見證，也為日治時期移民產業提供有利的註腳。</p>\r\n', '2012-08-16', NULL, '20120816194351.jpg', '0', '壽豐鄉', '0', 0, '花蓮縣', '花蓮縣壽豐鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000008, 0, 117, '太魯閣國家公園遊客中心', '<p>\r\n	太魯閣隸屬<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>縣秀林鄉，太魯閣台地位於台九線(蘇花公路)與台八線(中橫公路)交會點，此處也為太魯閣國家公園之東部入口，總面積約三公頃，台地上設置了太魯閣遊客中心、國家公園管理處行政中心及國家公園警察隊，遊客中心內規劃有人與自然館、生態遊憩館、兒童環境教育館及特展室，提供旅客詳盡的旅遊資訊。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	服務時間<br />\r\n	<br />\r\n	開館時間：上午08：30分至下午4：45分<br />\r\n	<br />\r\n	休館日：每月第二週的星期一（遇國定假日則順延）及除夕日<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	服務項目<br />\r\n	<br />\r\n	1、旅遊服務諮詢：TEL：（03）8621100（轉360、361、801－805）。<br />\r\n	<br />\r\n	2、預約簡報（影片）、展示館導覽及解說帶隊只要您的團體人數在15人以上即可預約。</p>\r\n', '2012-08-16', NULL, '20120816194533.jpg', '0', '秀林鄉', '0', 0, '花蓮縣', '花蓮縣秀林鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000009, 0, 118, '新光兆豐休閒農場', '<p>\r\n	兆豐休閒農場位於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>壽豐溪和<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>溪匯合處之河川新生地，東西兩側有海岸山脈及中央山脈為屏障。由於兆豐農場為河川新生地，石礫密佈，水土保持不易，所以在開墾期間曾遭受三次嚴重的颱風侵襲，開發過程倍嚐艱辛。但在持續投入資源之下，休閒旅遊的觀念日趨普及之時，兆豐農場為了服務日益增多的遊客，更在農場中規劃渡假旅館、戲水區、大型花卉溫室、森林公園等無垠的農場風光。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	農場入口位於鳳林鎮林榮里公路邊，入口處矗立一隻站立的大乳牛雕塑，十分醒目。休閒農場園區廣闊，佔地兩百餘公頃，裡頭有餐廳、農場品展售中心、大型會議室，有果園區、乳牛區、可愛動物區，以及人工湖，可露營、野炊、釣魚、採果、捉泥鰍、乘牛車、擠牛奶、騎協力車等。目前巳經成為融合農、林、漁、牧特色的休閒活動場所，潭湖中天鵝悠閒的浮游於上、搭配著水榭庭台，給人一片祥和的感覺，除此之外，尚有藥草植物區、自然鳥園、環頸雉園區、兒童遊樂區、更有專人解說乳牛的生態習性及飼養方法，遊客可親自哺乳小乳牛。並有漁池供遊客垂釣，池畔可以烤肉、野餐，另外還有可愛動物區座落於其間，可在此度過自然悠閒的假期!</p>\r\n', '2012-08-16', NULL, '20120816194717.jpg', '0', '鳳林鎮', '0', 0, '花蓮縣', '花蓮縣鳳林鎮', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000010, 0, 119, '親不知子斷崖', '<p>\r\n	由磯崎南下順海岸而行，經一片九孔養殖場，續行不久，可見一穿越斷崖絕壁之新磯隧道，隧道旁即是昔日所謂的親不知子斷崖。此地處處分布危巖峭壁，素以險峻著稱，花東公路未開鑿之前，磯崎至<a class="keycount" href="http://sinshe.okgo.tw/" title="新社民宿">新社</a>間的斷崖是附近村落與外界的聯絡孔道，因路窄、壁狹，行走不易，相傳有一雅美族婦人背著小孩走過斷崖，行走時因過度緊張，攀援過崖後，才驚然發覺小孩已不見蹤影。後人因此典故，便稱此為「親不知子斷崖」，意指斷崖的驚險，雖是父母子女之親也難以扶持共濟。</p>\r\n', '2012-08-16', NULL, '20120816194835.jpg', '0', '豐濱鄉', '0', 0, '花蓮縣', '花蓮縣豐濱鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000011, 0, 120, '虎頭山', '<p>\r\n	虎頭山位於瑞穗西北側，為丹大山向東延伸的一突出稜脈，標高1747公尺，頂上有一巨岩，如虎踞山頭，故名之。產業道路通往的山上有幾處果園以及儉樸寺院，高處視野遼闊可見花東縱谷中的瑞穗風情。</p>\r\n', '2012-08-16', NULL, '20120816195011.jpg', '0', '瑞穗鄉', '0', 0, '花蓮縣', '花蓮縣瑞穗鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000012, 0, 121, '明利飛行傘起飛場', '<p>\r\n	為了準備迎接鳳林遊憩區的飛行傘熱，飛行傘好手已經在遊憩區正西邊的明利山找到一處條件絕佳的起飛高台，位在明利村上部落上去二公里之，海拔約八百公尺，當地視野遼闊，飛行領域廣，飛行域東到<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>溪，南至光復，北到鳳林一帶。最讓飛行傘好手特別中意的是當地風勢強、氣流穩定，曾經在當地起飛的飛行傘好手表示，一起飛，就會被風拉到雲層頂端。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	明利山高台具有風勢強、氣流穩定的優點，下方現成有訓練場地，是其他高台所欠缺。一名初學者在遊憩區體驗坡學習起飛的竅門，成熟之後就近可以到明利山高台和教練共飛，鳳林遊憩區、明利山未來成為飛行山傘訓練以及飛行的熱門場地，指日可待。</p>\r\n', '2012-08-16', NULL, '20120816195813.jpg', '0', '萬榮鄉', '0', 0, '花蓮縣', '花蓮縣萬榮鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000013, 0, 122, '安通溫泉', '<p>\r\n	安通溫泉位於玉里鎮安通溪畔，離玉里約七‧八公里，泉源早在民國前八年發現，當時由於缺乏經費而未開發。民國十九年，玉里鎮公所已經闢建公共浴場，以後並不斷整修與擴建。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	安通溫泉水近透明，稍帶有硫化氫的臭味，可治外傷、皮膚病、胃腸疾病、婦人病等，溫泉湧二口溫度達六十六度，水量大，溫泉沿溪岸外流，範圍達三百公尺，附近居民常挖地露天而沐，憑添不少鄉野氣息，由於水溫高，亦可煮蛋而食。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	目前，安通溫泉有日據時代遺留下來的安通溫泉旅社，建築分新舊兩部分，舊式建築為日式通鋪型房間，附設男女浴池各一；新式建築為一白色兩層洋樓。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	坐落花東縱谷間的安通溫泉擁有青山碧水的秀麗環境，其泉質屬於食鹽硫化氫泉，透明並富含礦物質，泉水源於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>玉里的安通溪畔，溫度高達66℃且水量相當豐沛，因而形成溫泉隨溪流漫延的景象；而「安通濯暖」也曾是著名的<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>八景之一。</p>\r\n', '2012-08-16', NULL, '20120816202717.jpg', '0', '玉里鎮', '0', 0, '花蓮縣', '花蓮縣玉里鎮', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000014, 0, 123, '六十石山金針農園', '<p>\r\n	六十石山位於富里鄉東北側，早年因土地收成不錯，每甲地可出60石（約6000斤）穀子而得名。現今以種植茶樹及金針為主的六十石山，以其廣達300公頃的金針種植面積，成為台灣重要的金針產地。在每年7、8月金針採收期，當地機關都會舉行金針產業觀光的活動，吸引大批遊客前來體驗金針山風情。<br />\r\n	&nbsp;</p>\r\n', '2012-08-16', NULL, '20120816202909.jpg', '0', '富里鄉', '0', 0, '花蓮縣', '花蓮縣富里鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000015, 0, 124, '山風瀑布', '<p>\r\n	山風瀑布位於瓦拉米步道入口二公里處，從瓦拉米步道入口處走，一路草木芬芳，撲鼻清香。卓溪大山山勢壯闊，氣＆#34164;豪邁，山風一號吊橋懸於石崖間，河流對岸岩石紋理歷歷可見，腳下的溪流淙淙流瀉，邁出第一步，考驗自己的膽識。至山風瀑布處有觀瀑亭，只見瀑布水流灑落如白絹，瀟灑無比，而瀑布水源自大里仙山，水流經山風二號吊橋，一瀉而下，夏日裡，行經吊橋，涼意迎面拂來，暑氣全消。順著長長的階梯下行，可由梯下涼亭觀瀑，看著水流滴溜溜的打著轉兒，從大石上滑下，掉進壺穴，又落到另一段水道中，如此躍動不息，心情也跟著水流輕快靈動了起來。</p>\r\n', '2012-08-16', NULL, '20120816203302.jpg', '0', '卓溪鄉', '0', 0, '花蓮縣', '花蓮縣卓溪鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000016, 0, 125, '鍾家古厝', '<p>\r\n	鍾家古厝原為三和院式建築，樑柱均是當年鍾家壯丁到山上砍下的珍貴檜木，並自己製作泥磚砌成，屋內的雕刻、繪畫以及對聯提字，均請大陸的名師工匠設計，整個過程十分精密而謹慎，共歷經兩年才完成。隨著家族人丁繁衍，鍾家古厝已成為家族的祠堂。數年前的刮風吹垮左右兩落之後，由於缺乏經費修繕，目前只剩祭祖的中堂。鍾家古厝難敵時間的侵蝕逐漸頹圮，但數十年前斑駁的壁畫和裝飾，以及昔日的器具、桌櫃、古書，都可窺見過去精緻的生活和品味。</p>\r\n', '2012-08-16', NULL, '20120816203420.jpg', '0', '光復鄉', '0', 0, '花蓮縣', '花蓮縣光復鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000017, 0, 126, '台東鯉魚山公園', '<p>\r\n	鯉魚山位於<a class="keycount" href="http://tt.okgo.tw/" title="台東住宿">台東</a>市西側，原名「鰲魚山」，因外形相似鯉魚而得名，今稱「卑南山」。鯉魚山的地質構造為卑南角礫岩，高約75公尺，是<a class="keycount" href="http://tt.okgo.tw/" title="台東住宿">台東</a>市區的重要地標。天氣晴時，可以遠眺<a class="keycount" href="http://lanyu.okgo.tw/" title="蘭嶼民宿">蘭嶼</a>及<a class="keycount" href="http://ludao.okgo.tw/" title="綠島民宿">綠島</a>。這裡的山景相當秀麗，山腳下有龍鳳佛堂、忠烈祠和鯉魚山公園，連成一道吸引人潮的風景區。</p>\r\n', '2012-08-16', NULL, '20120816203813.jpg', '0', '台東市', '0', 0, '臺東縣', '臺東縣台東市', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000018, 0, 127, '成功鎮海濱公園', '<p>\r\n	<font color="#333333">海濱公園位於成功港口北方約一公里處，原來是一個垃圾掩埋場，後鎮公所改建為公園。園內花木扶疏，綠草碧茵，海風徐拂，彷彿置身南國；此處亦是市區觀賞海景的好地點，各項設施俱全，若您欲往臺東一遊，此處您絕對不可以錯過，以免一失飽覽東海岸之美。來此可遠眺三仙台，視野遼闊令心心曠神怡忘卻塵囂，來此吹風聽海聲或享受逐浪之樂，為全家休閒好去處。</font></p>\r\n', '2012-08-16', NULL, '20120816204318.jpg', '0', '成功鎮', '0', 0, '臺東縣', '臺東縣成功鎮', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000019, 0, 128, '關山環鎮自行車道', '<p>\r\n	關山環鎮自行車道位於關山鎮隆盛路1號，是全台第一座專用自行車旅遊道路。自行車道全程12公里，恰好環繞全鎮一周，輕鬆騎乘約需一個鐘頭。車道以水泥路面為主，中間輔以紅磚裝飾成中線分隔，雙向都可通行，兩側亦有枕木欄杆充分維護騎乘者的安全。在這條自行車道的景點有素有「小瑞士」之稱的關山大圳與楝園桃花心木步道，以及環保親水公園。自行車道上的幾處高坡，則是瞭望關山鎮景的好景點。關山環鎮自行車道全線平緩易騎，相當適合親子共遊，附近出租自行車的商店很多，遊客不必擔心沒有車子可騎。&nbsp;</p>\r\n', '2012-08-16', NULL, '20120816204512.jpg', '0', '關山鎮', '0', 0, '臺東縣', '臺東縣關山鎮', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000020, 0, 129, '八仙洞', '<p>\r\n	&nbsp;</p>\r\n<div class="tour_content">\r\n	<p>\r\n		位於11號省道78K處，根據地質學家的研究，此處的地形乃因地殼上升過程中受海水侵蝕，由上而下依序所形成的一群大小不一的洞穴，計有靈岩、潮音、永安、乾元、海雷等十多個，目前建有完整的步道，通往各洞穴。八仙洞也是考古學家最早發現舊石器時代史前文化遺址所在地，為台灣最早的史前文化遺址，民國77年被內政部指定為國家一級古蹟。東管處在此設有「史前文化遺址」展示室，其內展示史前人類文物與解說，並且詳述洞穴之成因，值得前往解讀一番。</p>\r\n</div>\r\n', '2012-08-16', NULL, '20120816204721.jpg', '0', '長濱鄉', '0', 0, '臺東縣', '臺東縣長濱鄉', NULL, NULL, NULL, 'AAA', '22', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000021, 0, 130, '天龍吊橋', '<p>\r\n	天龍吊橋位在海端鄉的天龍橋風景區內，海拔高度約為721公尺，全長為110公尺，為一座橫跨霧鹿峽谷的紅色吊橋，橋下為新武呂溪的湍湍溪水。風景區內擁有峽谷、斷崖、奇石及溪流等壯麗的景致，山壁還會湧出霧鹿溫泉的鹼性碳酸泉，站在天龍吊橋上可欣賞鬼斧神工般的美景，假日時經常有民眾到此進行森林浴、露營、健行及烤肉等休閒活動。&nbsp;</p>\r\n', '2012-08-16', NULL, '20120816211041.jpg', '0', '海端鄉', '0', 0, '臺東縣', '臺東縣海端鄉', NULL, NULL, NULL, 'AAA', '12', 0, '%,1人:1-2,%,%,%');
INSERT INTO `product` VALUES (0000000022, 0, 131, '池上牧野渡假村', '<p>\r\n	池上牧野渡假村位在花東縱谷的終點，周圍翠綠山巒環繞，面積廣大景致宜人，南邊有清澈的新武呂溪，北邊是池上大坡池風景區，大片的草原上有石牆、綠草、白欄杆及牛羊交織出濃厚的牧野風情，更遠從蒙古引進蒙古包及文物等物品，每年度皆會舉行蒙古「那達幕大會」，有著小塞北的美稱。池上牧野渡假村內設有野生動物觀賞保護區、蒙古風味餐廳、露營區及七十間住宿套房，擁有大自然的綺麗風光，是假日休閒的好去處。&nbsp;</p>\r\n', '2012-08-16', NULL, '20120816211205.jpg', '0', '池上鄉', '0', 0, '臺東縣', '臺東縣池上鄉', NULL, NULL, NULL, 'AAA', '22', 0, '公園,人:1-2,三天,出團,火車');
