INSERT INTO `product_detail` VALUES (0000000020, '1', '<h6 class="uiStreamMessage" data-ft="{&quot;type&quot;:1,&quot;tn&quot;:&quot;K&quot;}">\r\n	<span class="messageBody" data-ft="{&quot;type&quot;:3}">【相戀容易相處難的星座排行】<br />\r\n	<span> 第一名：天蠍座很重視感情，認為愛情是要互相的，不過鬧起脾氣來</span><wbr>也是不好惹的。<br />\r\n	第二名：處女座總是喜歡碎碎念，個性十分固執。<br />\r\n	<span> 第三名：溫柔往往是大家對雙魚座的認知，表面好欺負的樣子，實際</span><wbr>，戰鬥力十足。<br />\r\n	第四名：巨蟹座會因為太在乎而情緒失控。<br />\r\n	第五名：雙子座總喜歡質疑，無理取鬧，不甘心。</wbr></wbr></span></h6>\r\n');
INSERT INTO `product_detail` VALUES (0000000021, '1', '<p>\r\n	<span>看看牠的眼神!!!!依舊期待回家期待玩耍的臉，完全不知道過兩</span></p>\r\n<div class="shareSubtext fcg">\r\n	<wbr>天就要安樂死了....殘忍的人類究竟憑什麼愛牠卻又棄養牠<br />\r\n	在高雄壽山收容所！他有項圈有剃毛，救他</wbr></div>\r\n');
