INSERT INTO `product_detail` VALUES (0000000028, '1', '<p>\r\n	<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>酒廠位於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>市中華路與中正路交界路口，為中華路、仁愛路、民國路與明義街所圍繞之完整街廓，北側鄰近明義國小及部分住宅區、西側慈善寺及東南側之遠東百貨商圈。整體而言屬於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>縣舊市區中心，為商業密集區域。該區自民國77年遷廠後業閒置十餘年，民國91年9月典交國有財產局管理。<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>縣政府工商旅遊局於民國九十一年五月完成「<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>舊酒廠歷史風貌公園規劃案」，以地方產業振興與在地居民生活需求之角度，提出酒廠再利用提出之構想。同年10月，<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>縣政府將全區登錄為歷史建築。面積約3.38公頃。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	酒廠佔地面積廣闊，內因應製酒的過程，有各種儲藏、蒸餾、冷藏空間，一棟一棟的廠房形制各有不同，空間充滿變化，並有一根高高的煙囪，成為對外<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>市民對酒廠的共同印象，酒廠的神秘特質，也醞釀出許多獨特的故事，一名酒廠員工就津津樂道，十幾年前一次大地震中，儲酒室裡的酒甕幾乎都翻倒傾落，紹興酒滿滿的流溢到溝裡，當時都可見到有人拿著杓子，在地上撈酒喝呢!這也是屬於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>人獨特的芬芳回憶。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000029, '1', '<p>\r\n	兆豐休閒農場位於<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>壽豐溪和<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>溪 匯合處之河川新生地，東西兩側有海岸山脈及中央山脈為屏障。由於兆豐農場為河川新生地，石礫密佈，水土保持不易，所以在開墾期間曾遭受三次嚴重的颱風侵 襲，開發過程倍嚐艱辛。但在持續投入資源之下，休閒旅遊的觀念日趨普及之時，兆豐農場為了服務日益增多的遊客，更在農場中規劃渡假旅館、戲水區、大型花卉 溫室、森林公園等無垠的農場風光。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	農場入口位於鳳林鎮林榮里公路邊，入口處矗立一隻站立的大乳牛雕塑，十分醒目。休閒農 場園區廣闊，佔地兩百餘公頃，裡頭有餐廳、農場品展售中心、大型會議室，有果園區、乳牛區、可愛動物區，以及人工湖，可露營、野炊、釣魚、採果、捉泥鰍、 乘牛車、擠牛奶、騎協力車等。目前巳經成為融合農、林、漁、牧特色的休閒活動場所，潭湖中天鵝悠閒的浮游於上、搭配著水榭庭台，給人一片祥和的感覺，除此 之外，尚有藥草植物區、自然鳥園、環頸雉園區、兒童遊樂區、更有專人解說乳牛的生態習性及飼養方法，遊客可親自哺乳小乳牛。並有漁池供遊客垂釣，池畔可以 烤肉、野餐，另外還有可愛動物區座落於其間，可在此度過自然悠閒的假期!</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000030, '22', '<p>\r\n	青蓮寺是瑞穗的信仰中心，廟裡供奉的主神為釋迦摩尼佛祖，其他還有關帝聖君、媽祖、土地公、註生娘娘等道教神祇，佛道同一家，我們常開玩笑說青蓮寺是廟宇 的7－eleven，只要走一趟青蓮寺，你要求什麼都可以，廟裡有一對竹籠已有一百多年的歷史，相傳在清光緒年間有一老翁挑了一對竹籠，寄放在打馬煙（現 瑞北）經過幾天未來領回，鄉民打開竹籠一看，原來是一對佛祖，竹籠內有一紙條指示籠中佛祖一尊鎮守水尾（瑞穗），另一尊則鎮守馬太鞍社（光復），民國61 年<a class="keycount" href="http://hl.okgo.tw/" title="花蓮住宿">花蓮</a>大地震震垮了青蓮寺，但廟裡的神像及竹籠都完好如初，可見神蹟廣大，現在這對竹籠已成為青蓮寺的鎮寺之寶。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000031, '1', '<p>\r\n	&nbsp;</p>\r\n<br />\r\n<p>\r\n	<li>\r\n		台東富岡/綠島來回船票</li>\r\n</p>\r\n<table border="0" class="text1" width="660">\r\n	<tbody>\r\n		<tr>\r\n			<td align="right" valign="top" width="130">\r\n				<strong>行程包含：</strong></td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<li>\r\n		綠島飯店住宿兩晚(含早餐)</li>\r\n</p>\r\n<p>\r\n	<li>\r\n		機車二人一部(含第一次油資)</li>\r\n</p>\r\n<p>\r\n	<li>\r\n		綠島夜遊行程乙次</li>\r\n</p>\r\n<p>\r\n	<li>\r\n		200萬履約責任險。(含3萬意外醫療險)</li>\r\n</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000032, '1', '<p>\r\n	<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>河濱公園建造於<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>河 畔，周圍青山綠水風景秀麗，站在河堤上欣賞山峰倒映在河面上，早期的美景「西堤晚眺」被選定為「蘭陽十八勝」之一。積極綠化公園環境，園區內也規劃有階梯 平台、籃球場、自行車道、棒球場及田徑場等設施，還可在河畔垂釣及划舟，廣大的公園區域經常做為活動場地，也是民眾假日休閒運動的好去處。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000033, '1', '<p>\r\n	須從金洋部落換乘吉普車，沿產業道路爬坡前進到登山口，車程需耗一小時半以上。<br />\r\n	<br />\r\n	登山步道進入神秘湖來回約一個小時半，路程相當好走，來到湖區青苔石較滑，欲往神秘湖朋友小心行走，此步道生態非常豐富，沿途蟲鳴鳥語，蛙群之多，蛇類出現頻繁，可持山杖打草驚蛇。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000034, '1', '<p>\r\n	大溪蜜月灣位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣 頭城鎮，是一處彎月型的海灣，南北兩側皆為礁岩，中間則是平緩細軟的沙灘，並可遠眺龜山島景緻，經常可見情侶雙雙對對漫步在沙灘上，因為有了蜜月灣的名 稱。蜜月灣因地形由淺至深，浪高約有一至三公尺，是熱愛衝浪運動的民眾聚集之處，每年皆會舉辦盛大的衝浪賽事，此外更有一片馬鞍藤短草的綠地可供民眾進行 露營的休閒活動。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000035, '1', '<p>\r\n	<a class="keycount" href="http://jiaosi.okgo.tw/" title="礁溪民宿">礁溪</a>溫泉早在清朝時期就已頗富盛名，清代舊名為「湯圍溫泉」的<a class="keycount" href="http://jiaosi.okgo.tw/" title="礁溪民宿">礁溪</a>溫泉為「蘭陽八景」之一。溫泉屬於鹹性溫泉，無色無味，可飲可浴，含有豐富的氯化鉀、硫酸鈉、重碳酸鉀、硼酸、有機物和流離酸等礦物質，據說溫泉可治療皮膚病，洗後皮膚光滑柔細，具有美容之效果，泉質相當優良，遠近馳名。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000036, '1', '<p>\r\n	枕山休閒農業區位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣 西北方，因形狀似枕頭而得此名，海拔高度僅七十五公尺，是一座獨立小山，周圍環境秀麗，並有多處自然景致，農業區內種植有多樣化的水果，早期則以桃李為 主，每年桃花李花盛開之際，美不勝收，因此又有「枕山花海」之美稱，近年因水果種類漸豐富改為「枕山春海」，遊客可到此品嚐優質的蓮霧、甜桃及金棗糕等農 特產品。枕山休閒農業區內建有多座農場、花園及民宿，是假日時與大自然親近的好去處。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000037, '1', '<p>\r\n	清水地熱(石門溪)位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣 大同鄉的溪谷之間，是由地下冒出的地熱泉，水溫高達攝氏95度，為帶有硫磺味的鹼性溫泉。清水地熱旁有一條清澈小溪，沿途佈有岩石及綠潭，加上地熱水煙瀰 漫，猶如人間仙境般優美。因地熱泉溫度過高並不適合浸泡，但山嵐景致秀麗，有許多遊客於假日時到此野餐，並用泉水煮食雞蛋、玉米、芋頭及蕃薯等食材，是相 當熱門的景點之一。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000038, '1', '<p>\r\n	香格里拉休閒農場位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣 冬山鄉的大元山麓，海拔高度為兩百五十公尺，佔地面積為五十五公頃，園區內規劃有四季觀光果園、烏心石採種園、農場步道、瞭望台及戀戀紅亭等設施，並以在 地特色餐飲、品茗、自然生態及ＤＩＹ體驗等活動，建立起完善的休閒農場。來到香格里拉休閒農場，您可以依造時令進行採果，園區積極復育螢火蟲，每到四、五 月份螢光點點，更有草編、波浪鼓、彩繪陀螺、天燈製作及木烙等ＤＩＹ體驗，是親近大自然的好去處。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000039, '1', '<p>\r\n	內埤海灘位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣 蘇澳鎮南方澳漁港外側的沙丘，沙灘呈現彎曲弧線，海天景致優美，有海岬、海蝕崖及海底岩礁等海蝕地形，以及以細砂石礫混合而成的海積沙灘，黃昏夕陽金黃光 芒閃耀，波波海濤聲聲入耳，並規劃有觀光涼亭、沿岸步道及停車場等設施，並種植有台灣樹蘭及台灣海桐等樹種，假日時吸引許多民眾到此遊憩垂釣，因此處海底 地形不平，海面下常有暗湧，到此戲水的民眾需注意自身安全。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000040, '1', '<p>\r\n	羅東夜市位在羅東公園旁，由興東路、民生路、公園路及民權路形成方塊型，是羅東市區相當熱鬧的區域，不僅有眾多平價的服飾、雜貨及美食等多種店鋪攤販，日 間則為家庭主婦經常前往購物的羅東菜市場。羅東夜市擁有許多美味小吃，包括龍鳳腿、台灣鹹滷味及包心粉圓等人氣小吃，其中又以曾於國宴料理中的肉捲最為著 名，經常吸引許多民眾慕名前來品嘗。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000041, '1', '<p>\r\n	濱海自行車道起點為蘭陽溪口的東港河口賞鳥區，終點則在壯圍鄉的吉安宮，車道全長為６．５公里，車道兩旁以種植文殊蘭為主，部份路段可眺望龜山島觀賞濱海 景致，海岸旁則種有海檬果、林投樹及木麻黃等防風林種。騎乘在濱海自行車道上，享受海風的吹拂，聆聽浪濤的聲響，還能欣賞蘭陽著名的陳溪美景－「龜山朝 日」，是自行車族相當喜愛的休閒路線。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000042, '1', '<p>\r\n	梵梵溫泉位在<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣 大同鄉梵梵溪的上游，是一處尚未開發的天然野溪溫泉，還保留著山林間的原始風貌，只有駕駛吉普車方可通過，現今因環保意識抬頭，許多民眾皆採用步行的方式 進入，不僅可以靜靜的享受山林風光，還可減少對大自然的傷害。梵梵溫泉為含有鎂鈣離子的鹼性碳酸泉，水溫大約在五十二度至七十度之間，除了可用來浸泡外， 還可供飲用。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000043, '1', '<p>\r\n	冬山河親水公園自民國76年規劃設計，民國83年6月正式啟用，園區位於<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>縣五結鄉，以全長24公里的冬山河河岸規劃出多功能的河濱遊憩區域，並以『親近水，擁有綠』定調為親水公園主題。<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	冬 山河親水公園為水陸合一的休憩區，區內有完善的戶外設施，包含生態保育區、親水遊戲區、休閒活動區、水上公園及海濱區&hellip;等，另有涉水池、划船池、露天野外 劇場、觀星台、賞月台&hellip;等具有當地特色的造景，知名的國際划船賽、龍舟賽、西式划舟、童玩藝術節等水上大型活動也都在親水公園舉行，各式各樣精彩的活動都 能夠令你流連忘返。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000044, '1', '<p>\r\n	<font color="#333333">若要探問花蓮的天公廟，一般人馬上聯想到位於嘉里村的天公廟（保安宮），一方面因其歷史悠久，屹立至今接近一世紀﹔一方面因香火鼎盛，連花蓮市的人口都以其為護佑神明。<br />\r\n	<br />\r\n	　 保安宮由於信徒眾多，天公會的組織也很壯大，除了協辦玉皇上帝聖誕慶典及修建廟宇外，也熱心推動社會公益及慈善濟助，頗獲好評。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000045, '1', '<p>\r\n	<font color="#333333">花蓮勝安宮目前已成為全省道教聖地之一，也是本地民眾祈福禳災精神寄託之處，每日香客絡繹不絕，由於建築宏偉富麗，雕樑畫棟及庭園景觀皆有可看性，亦為市郊有名之宗教勝地。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000046, '1', '<h4>\r\n	<font color="#333333">天祥的簡介</font></h4>\r\n<p>\r\n	<font color="#333333">天祥位於<strong>花蓮縣</strong>秀林鄉、大沙溪與塔次基里溪匯流處，為一開闊的河階台地，原名『塔比多』(Tupido)意思是山棕，這裡是泰雅族山胞的世居地，後來因紀念古人文天祥而改名為『天祥』；天祥是<strong>太魯閣峽谷</strong>的中心，風景優美且氣候宜人，是中橫公路沿線非常熱門的風景區，也是中橫公路的大轉運站。<br />\r\n	</font></p>\r\n<h4>\r\n	<font color="#333333">天祥－特殊的地形植被</font></h4>\r\n<p>\r\n	<font color="#333333">天祥地區的曲流、壺穴景觀是這裡特殊的地形樣貌，河階地上也有礫石層出露的痕跡；天祥的地質以西則是較年輕且岩層較鬆軟的綠色片岩、黑色片岩、千枚岩，以 東是經高度變質作用的大理岩層，不同的地質構造形成了獨特的景觀；溪谷中景色優美，植被因季節不同而變化色彩，天祥遊憩區內的闊葉生態林還有<strong>太魯閣</strong>大戟及<strong>太魯閣</strong>櫟兩種稀有植物，來到天祥可別忘了找尋這兩種植物一睹它們的風采。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000047, '20', '<h4>\r\n	<font color="#333333">紅葉溫泉簡介</font></h4>\r\n<p>\r\n	<font color="#333333">紅葉溫泉位於花蓮縣萬榮鄉紅葉村，紅葉村是因早年擁有大量楓樹，因楓紅而得名，近年來已積極復植讓紅葉地如其名；紅葉溫泉發源於紅葉溪上游的虎頭山，和瑞 穗溫泉及安通溫泉號稱花東縱谷的三大知名溫泉區；瑞穗溫泉共有兩處，以前是以萬榮鄉的瑞穗溫泉及紅葉溫泉較為知名，因此又有較接近市區街道的瑞穗溫泉被稱 為外溫泉，較靠近山區的紅葉溫泉就叫做內溫泉。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000048, '1', '<p>\r\n	<font color="#333333">由凱旋門旁售票口進入，可見美麗廣場上的花園,景色十分怡人！園區內各項設施有：歐式花園、住宿區小木屋、 遊客活動中心、大草原、侏羅紀公園、草藥花卉區、可愛動物區、乳牛放牧區、觀光果園、鳥園區、釣魚池、名人植樹區、柳波湖划船區、曲橋觀鯉、龍魚噴泉、搖 控船區、翠影天鵝等。<br />\r\n	<br />\r\n	景觀區佔地18公頃，由一座結合九族原住民，和農場拓荒墾荒塑像的歐式花園遊客活動中心，萬坪大草原和四秀湖組合而成，在這裡你可以循著環湖小道漫步欣賞湖光山色，也可以到大草原放風箏、玩飛盤。<br />\r\n	<br />\r\n	農場為台灣省雉雞協會東區推廣教育中心，雉雞類多遠20餘種，並引進世界各地觀賞鴿，及大小鸚鵡和孔雀區，在這裡你可以餵食野放的白鴿、孔雀、火雞和上百隻的珠雞，樂趣無窮。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000049, '12', '<p>\r\n	<font color="#333333">太巴塱位於光復鄉東側，隔著嘉農溪與馬太鞍部落為鄰。昔日因此地多螃蟹，故以阿美族與『螃蟹（即太巴塱）』 命名。地方青年為了保存部落傳統的生活文化，於近年來積極推廣織布、籐編、歌謠吟唱、野外訓練、木雕等課程，並著手整理部落史料。因此現在在太巴塱國小、 太巴塱文化館以及太巴塱阿美族文物展示室中，可以看到各項傳統技藝文物重現。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000050, '12', '<p>\r\n	<font color="#333333">月洞位於花蓮縣豐濱鄉，南距港口村約一公里，目前為私人開闢經營的神祕岩洞，其海拔高約八十公尺， 距海岸約八百公尺，洞口高約二十五公尺，造型十分獨特。山洞內分左右兩洞穴，左方洞口較大，可深入約五十公尺，上方尖狹，頂端棲息成千上萬的蝙蝠，憑添幾 許神祕氣氛。右方洞穴較短，約四十公尺，洞內幽暗神祕且洞中有水，洞內有鐘乳石、石筍、魚頭化石、燕窩化石、蝙蝠群、伏流及滴數等，想入洞探秘參觀，必須 搭乘專人操作之小舟，藉著舟上的照明燈光，方能一睹奇景。「月洞」有著許多傳說：「月洞」原本就是一個天然洞穴，洞中積水成湖約五公尺左右，且會隨著月之 盈虧而漲落，所以有人稱之為「月井」。湖中有許多鱸鰻，傳說中亦有所謂的千年鰻，而至目前為止曾發現最大隻的竟重達十餘公斤，已具攻擊人類的能力，目前尚 無人敢潛入水中探險。月洞的溫度約攝氏二十度左右，終年如一，冬暖夏涼，十分怡人。 </font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000051, '31', '<h4>\r\n	<font color="#333333">玉山國家公園簡介</font></h4>\r\n<p>\r\n	<font color="#333333"><strong>玉山國家公園</strong>於西元1985年成立是台灣第二個國家公園，位於台灣中心位置，範圍涵蓋南投縣、嘉義縣、高雄市和花蓮 縣，總面積約達105490公頃，是台灣面積最大的國家公園，地形以高山及河谷為主，橫跨玉山山脈和中央山脈等山系，包含海拔3952公尺擁有「東北亞第 一高峰」美稱的玉山主峰、玉山東峰、玉山北峰、玉山南峰、玉山西峰和<strong>八通關</strong>山等玉山山系以及秀姑巒山、<strong>關山</strong>、<strong>三叉山</strong>、向陽山和<strong>新康山</strong>等中央山系共30座，天然植被也隨著海拔的變化從亞熱帶、溫帶至寒帶，豐富的地理景觀塑造最珍貴的資源寶藏和生態環境。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000052, '1', '<p>\r\n	<font color="#333333">阿美文化村是花蓮著名的觀光地旨在對中外來賓介紹山胞從前的生活型態。文化村工周的圍牆將其與外界隔 開，兩排竹舍儼然，古樸中散發濃郁的山地氣息。村中央有一尊高達二十二公尺的神像供人瞻仰留念，村內除了經營紀念品、飾品、大理石器及土產店外，並陳列了 許多阿美族原始住屋、服飾、日用器皿、漁獵工具及山胞最早來台所乘載的獨木舟等文物，是遊客認識阿美文化最佳的場所。 阿美族男女歌聲渾雄柔美，舞姿美妙動人，傳統山地歌舞表演風格獨特，名聞遐邇。每日有五場次表演，除末兩場固定表演外，其餘三場依人數多寡再決定是否表 演，節目主持人係每年豐年祭中選出的阿美皇后，其演出的項目包括婚禮舞、追源舞、農耕舞打米舞，勇士精神舞等。 此外村欠並置有獨特的大餐，來此一遊可盡情享受視覺上的娛樂，同時可飽嘗美食，實為一娛樂休閒的好去處。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000053, '1', '<p>\r\n	<font color="#333333">大興文旦觀光果園位於光復鄉南方的大興村，鄰近大興瀑布、秀姑巒溪泛舟、蝴蝶谷森林遊樂區等風景名勝。 距光復火車站3公里，大型遊覽車可以暢通。且農園區風景優美，文旦柚果實碩大香甜，沿台9線一路北上，沿途椰樹、玉米田、稻田、蔗田等富庶的平原景觀，為 長程的旅途憑添幾許心靈與視覺上的享受。</font></p>\r\n');
INSERT INTO `product_detail` VALUES (0000000054, '9', '<p>\r\n	三仙台位於成功東北方約3公里處(11號省道112K處)，其地質屬都巒山火山集塊岩，因海水侵蝕，使得岬角逐漸斷了頸部，形成離岸島，三仙台最具特色的 八拱紅色跨海步橋，造型奇特，島上除了有段傳神的八仙過海故事，這兒的海域魚類、動植物生態豐富，也是著名的磯釣場所，玩家們到此一遊也不妨安排2小時上 島遊覽，欣賞壺穴，海蝕洞，海蝕溝、海蝕凹璧等特殊地形。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000055, '35', '<p>\r\n	關山環保親水公園是全台灣首座運用空污防治費所建立的環保公園，此座親水公園與<a class="keycount" href="http://el.okgo.tw/" title="宜蘭住宿">宜蘭</a>親水公園為一體，引山入景的設計令人驚豔，公園內更設有親水戲水池、垂釣、划船及表演廣場等設施。關山鎮全長十二公里的環鎮自行車道也吸引許多民眾前往遊覽，親水公園內設有一段水上自行車步道，讓遊客可以「連人帶車」輕鬆遊憩，享受環保的綠活氣息。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000056, '1', '<p>\r\n	烏石鼻位在<a class="keycount" href="http://tt.okgo.tw/" title="台東住宿">台東</a>縣 長濱鄉石寧埔溪口的東南側，是一塊突出於海面上的黑色岩石岬角，因為岩石像人的鼻子一樣像外延伸，而得「烏石鼻」的名稱。烏石鼻為柱狀節裡的黑色安山岩， 向海中延伸約兩公里，寬度則約為兩百公尺，周圍有著多處潮池及海蝕溝，相當適合觀察潮間帶生態，鄰近海域還有豐富的魚群生物，吸引許多民眾前來潛水及磯 釣，是東海岸頗負盛名的磯釣場。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000057, '9', '<p>\r\n	天龍吊橋位在海端鄉的天龍橋風景區內，海拔高度約為721公尺，全長為110公尺，為一座橫跨霧鹿峽谷的紅色吊橋，橋下為新武呂溪的湍湍溪水。風景區內擁 有峽谷、斷崖、奇石及溪流等壯麗的景致，山壁還會湧出霧鹿溫泉的鹼性碳酸泉，站在天龍吊橋上可欣賞鬼斧神工般的美景，假日時經常有民眾到此進行森林浴、露 營、健行及烤肉等休閒活動。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000058, '1', '<p>\r\n	池上牧野渡假村位在花東縱谷的終點，周圍翠綠山巒環繞，面積廣大景致宜人，南邊有清澈的新武呂溪，北邊是池上大坡池風景區，大片的草原上有石牆、綠草、白 欄杆及牛羊交織出濃厚的牧野風情，更遠從蒙古引進蒙古包及文物等物品，每年度皆會舉行蒙古「那達幕大會」，有著小塞北的美稱。池上牧野渡假村內設有野生動 物觀賞保護區、蒙古風味餐廳、露營區及七十間住宿套房，擁有大自然的綺麗風光，是假日休閒的好去處。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000059, '1', '<p>\r\n	都蘭遺址位在<a class="keycount" href="http://tt.okgo.tw/" title="台東住宿">台東</a>縣 東河鄉的都蘭村，分布於都蘭村西北方約一公里的平緩海階地，距今約為兩千至三千年前，為麒麟文化遺址。都蘭遺址屬於三級古蹟，在區域內發現有岩棺、石輪、 石柱及人形石像等遺址，分為岩棺區和石壁區，主要特色為多樣的巨石佇立，正是巨石文化遺址，目前欲設立「都蘭遺址公園」。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000060, '9', '<p>\r\n	鹿野高台觀光茶園位於鹿野鄉高台路46號，鹿野古稱「鹿寮」，新武呂溪及鹿野溪在此匯成卑南大溪，由於日夜溫差大且無空氣污染，所以非常適合茶樹生長。產茶量每年可採收六次。民國71年，當時任省長的李總統巡視鹿野時，特別予以命名「福鹿茶」。此外，<a class="keycount" href="http://tt.okgo.tw/" title="台東住宿">台東</a>現有的飛行傘、滑翔翼練習場，皆位於觀光茶園一帶，假日來此，常可見到花花綠綠的飛行傘翱翔天空，為茶園增色不少。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000061, '1', '<p>\r\n	紅葉溫泉親水公園位於延平鄉紅葉村紅葉溪流邊，公園的石柱砌上紅葉標誌，目前已有賞景步道、露天浴池、戲水池、山泉戲水道、烤肉區等設施陸續完工，遊客可以前往享受大自然所賦予的野溪溫泉。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000062, '31', '<p>\r\n	知本溫泉位於卑南鄉溫泉村龍泉路1號，屬鹼性碳酸泉，有著「東台第一景」的美名，溫泉區分為內、外兩處溫泉點，兩處皆經過開發，由許多溫泉觀光飯店及旅館 進駐，因此，想要體驗知本著名的溫泉，都相當方便，另外，知本溫泉區原為原住民聚集地，這裡的山產店也非常的多，間間美食別具風味，遊客享受泡湯之餘，不 妨品嚐一下這裡的各式山菜野味。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000063, '1', '<p>\r\n	金峰溫泉位於南迴公路西方的嘉蘭村內，泉質清澈透明，可飲可浴。由於金峰溫泉位置離村落太遠，使用率很低，僅有少數村民沐浴用。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000064, '1', '<p>\r\n	大武國家森林步道位於大武鄉境內，又有「台灣後花園」的美名，步道全長約1.3公里，屬環狀枕木道路，步道的起點在林務局大武工作站旁，由於海拔不高，走 起來十分輕鬆，此外沿途蝴蝶、昆蟲相伴，累了，路旁時有石桌和座椅可供休息，是一條深受民眾喜愛的健行路線。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000065, '1', '<p>\r\n	排灣族文化藝術社區位在<a class="keycount" href="http://tt.okgo.tw/" title="台東住宿">台東</a>縣 達仁鄉的土坂社區，排灣族是一個注重階級的族群，共分為頭目、貴族、勇士及平民四個階層。目前在土坂社區部落裡有兩座祖靈屋，是供族人祝禱祭祀之用，由於 祖靈屋為相當神聖的區域，若要參觀或拍攝留念必先徵得同意，並尊重當地文化。土坂社區部落內保留史前文化藝術遺址的石棺等珍貴文物，且有許多原住民木雕 家、藝術家及文化工作者，處處展現著排灣族獨特的文化風情。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000066, '35', '<p>\r\n	帆船鼻位於<a class="keycount" href="http://ludao.okgo.tw" title="綠島民宿">綠島</a>東 南角，地形上是個三面環海的海岬，高出海平面約30m的隆起珊瑚礁海階台地。台地面相當平坦，卻幾近垂直的海崖與海岸現生珊瑚礁相接。後天的放牧，遂形成 低草原景觀。草原上常見野放山羊低頭吃草，偶而也會出現台灣梅花鹿。如茵的綠草原與四同的藍天碧海，成構極佳之景緻。往北眺望，遠處海參坪一帶的海崖及嵯 峨奇岩；近處是朝日溫泉的三個圓型溫泉池，及新穎的建築設施；往西，為白沙灣的大片珊瑚裙礁。天氣晴朗時，南方海天交接處可見到<a class="keycount" href="http://lanyu.okgo.tw/" title="蘭嶼民宿">蘭嶼</a>。處居高臨下，是<a class="keycount" href="http://ludao.okgo.tw" title="綠島民宿">綠島</a>欣賞日出、月昇的最佳景點之一。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000067, '1', '<p>\r\n	坦克岩位在靠珊瑚礁岸的岩石，此岩是由火山噴出的碎屑物堆積而成，形狀就像少了砲管的坦克車，因此而得名。岩上長滿了綠苔，岩石中有大洞穿透，可以看見當地的牛、羊穿梭其間，景致相當動人。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000068, '1', '<p>\r\n	金崙溫泉位於太麻里溪畔，在太麻里知名度打開之後，金崙溫泉也跟著開發出來。泉質屬於鹼性碳酸泉，泉溫約攝氏70~90度左右。溫泉豐沛，為最佳野溪泡湯地點。每個角度都可以居高臨下遠眺太平洋，或看南迴鐵路的火車穿梭眼前。</p>\r\n');
INSERT INTO `product_detail` VALUES (0000000069, '35', '<pre>\r\n　太平山區幅員廣大，面積約１２６３１公頃，包括土場、仁澤、中間、蘭台、白嶺、上平、太平山\r\n　、翠峰湖、三疊瀑布、獨立山等景觀據點。其中仁澤、太平山、翠峰湖等三處規畫完善；太平山原\r\n　始森林公園、三疊瀑布、等多處森林浴場，昔日高山運材鐵道闢建的蹦蹦車道與伐木設施等，不但\r\n　可認識台灣早期的林業史與高山地區的自然景觀，更適合登山健行活動。昔日為伐木作業場所，因\r\n　而目前仍留有當年的作業器械，如流籠、索道、運材鐵道、蒸氣集材機等等，值得您細細品味。太\r\n　平山莊旁步道紫葉槭之美，絕對讓你不虛此行。</pre>');
